#!/usr/bin/env perl
use strict;
use Data::Dumper::AutoEncode;
use XML::LibXML;
local $/; # no line separator
$|++; # no buffering

my $hash = {};
my $doc = XML::LibXML::Document->new('1.0', 'UTF-8');
my $data = <DATA>;
my @data = split /\n\n/, $data;

analyse($_) for @data;
# printf ("%s %s", scalar @data, scalar keys %$hash);
my $root = $doc->createElement('zss');
my $count = 0;
xml($root, $_) for sort keys %$hash;
$root->setAttribute('count', $count);
print $root->toString(1);

# -------------------------
sub xml {
# -------------------------
	my ($root, $key) = @_;
	my $zs = $hash->{$key};
	next unless ($zs->{online} && $zs->{druck});
	$count++;
	my $el = $root->addNewChild(undef, "zs");
	$el->setAttribute('title', $zs->{ti}->[0]);
	for my $key (qw(online druck)) {
		for my $item (@{$zs->{$key}}) {
			$el->appendTextChild($key, $item);
			}
		}
	}

# -------------------------
sub analyse {
# -------------------------
	my $entry = shift;
	my @lines = split /\n/, $entry;
	my $res = {};
	my $titel;
	for my $line (@lines) {
		my ($key, $val) = split /\s+\-\s+/, $line;
		next unless length($key) == 2;
		# push @{$res->{lc($key)}}, $val unless $key =~ /TY|ER|KW|N1|PB|CY/;
		push @$titel, $val if $key eq "TI";
		push @{$res->{online}}, $val if ($key eq "N1" && $val =~/^Online/);
		push @{$res->{druck}}, $val if ($key eq "N1" && $val =~/^Druck/);
	}
	return unless $titel;
	my $t = join(" ", @$titel);
	push (@{$hash->{$t}->{ti}}, $titel->[0]);
	for my $k (qw(online druck)) {
		push (@{$hash->{$t}->{$k}}, @{$res->{$k}}) if $res->{$k};
		}
	}

